import React from 'react';
import { Card, Button } from 'react-bootstrap';

function HomePage() {
  return (
    <div>
        <Card bg="primary" text="white" className="text-center">
        <Card.Body>
            <Card.Title>Welcome to My Website</Card.Title>
            <Card.Text>
            This is the home page of my website. You can add your own content and styling here.
            </Card.Text>
        </Card.Body>
        </Card>
        <div>
            <Button variant="primary" size="lg" href="/about">Learn More</Button>
            <Button variant="primary" size="lg" href="/contact">Contact Us</Button>
        </div>
    </div>
  );
}

export default HomePage;
